import React from 'react';
import axios from 'axios';

export default class WorkTermList extends React.Component {
    state = {
      workTermsNames: []
    }

    componentDidMount() {
      axios.get(`/wp-json/wp/v2/custom_work_category/${taxonomy_id}`)
        .then(res => {
          const workTermsNames = res.data;
          this.setState({ workTermsNames });
        })
    }

    render() {
      return (
        <ul>
          { this.state.workTermsNames.map(termName => <li>{termName.name}</li>)}
        </ul>
      )
    }
  }
